webpackJsonp([0xe2da8b41ee42],{398:function(A,a){A.exports={data:{markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 400px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 63.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Dog no idea"\n        title=""\n        src="/static/no-idea-6ba5a5aa8066a1b37579c6b96f7ce941-4fa8c.jpg"\n        srcset="/static/no-idea-6ba5a5aa8066a1b37579c6b96f7ce941-0eaf6.jpg 200w,\n/static/no-idea-6ba5a5aa8066a1b37579c6b96f7ce941-4fa8c.jpg 400w"\n        sizes="(max-width: 400px) 100vw, 400px"\n      />\n    </span>\n  </span>\n  </p>\n<p>I have just started in the field, and I have realized very quickly that I have no idea what I am doing, and I imagine that I will feel this way for the rest of my life.  I am specifically interested in what a programming language is and what it can do.  I realize that there will be no end, and at no point, I will have a clue of what is going on.  Therefore, I have accepted a simple truth that I will never actually understand what I am doing at any given point of time.</p>\n<p>I have been fortunate to enter the software engineering industry from a very non-traditional background.  I would like to share this knowledge on how to get your first software engineer job.  Quick answer?  I studied 12-14 hours every single day for 6 months.  Well, it is a little more involved than that, and I want to write a helpful and actionable guide.  A part of the process is understanding the fundamentals of key algorithms and data structures.  The process is not easy.</p>\n<p>Also, this blog is a documentation of my growth for my own purposes.  A year from now, I imagine I will be laughing hard at my own ignorance.  And again the year after that, and it goes on.</p>\n<p>Anyway, enough rambling.</p>\n<ul>\n<li>Kevin</li>\n</ul>',timeToRead:1,excerpt:"I have just started in the field, and I have realized very quickly that I have no idea what I am doing, and I imagine that I will feel thisâ€¦",frontmatter:{title:"I have no idea what I am doing",cover:"/covers/facepalm.png",date:"2017-12-27",category:"rambles",tags:["ramble"]},fields:{slug:"/i-have-no-idea-what-i-am-doing"}}},pathContext:{slug:"/i-have-no-idea-what-i-am-doing",path:"/rambles/i-have-no-idea-what-i-am-doing"}}}});
